import { useState } from "react";

function ChatList(){

    const [chats, setChats] = useState([{
        name:"Tom",
        age: 16,
        color:"purple",
        id:1
    },
    {
        name:"Kim",
        age: 17,
        color:"black",
        id:2
    }])

    return(
        <div style={{border:"5px solid black", paddingBottom: "800px"}}>
            <p>ChatList</p>
            <input type="text"></input>
            <button>Search</button>


            {chats.map((chat, id) => {
                <div key={id}>
                    <p>{chat.name}</p>
                </div>
            })} 
        </div>
    )
}

export default ChatList;
